const Learn_Intertop = (props) => {
  const { car } = props;

  return (
    <section
      className="h-screen bg-fullcenter text-center"
      style={{ backgroundImage: "url(" + car.interior.topImage + ")" }}
    >
      <h2 className="w-full h-2/4 shadowFromTop font-bold md:text-6xl text-4xl">
        Future of the Interior
      </h2>
    </section>
  );
};

export default Learn_Intertop;
